from alterchar.alterchar import alternating_Characters
import unittest

class Alternating_CharactersTest(unittest.TestCase):
    def test_give_BBABAAAABB_is_5(self):
        string = 'BBABAAAABB'
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 5)

    def test_give_AAABBBAABB_is_6(self):
        string = 'AAABBBAABB'
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 6)

    def test_give_AAAABAAABBABBAAABAAABABBBBAAAABAABAABBAAABABBAAABABABABAABAABBAABAAABABABBBABBBAAAABABBABBAAAAABBAAA_is_47(self):
        string = 'AAAABAAABBABBAAABAAABABBBBAAAABAABAABBAAABABBAAABABABABAABAABBAABAAABABABBBABBBAAAABABBABBAAAAABBAAA'
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 47)

    def test_give_AABAABABAAAABABBABABBABAABBABBBABBABAABBABBABABBBBBBBABBAABBABBBABBAAABABBABBBABABABABAAAABABBBBAABA_is_39(self):
        string = 'AABAABABAAAABABBABABBABAABBABBBABBABAABBABBABABBBBBBBABBAABBABBBABBAAABABBABBBABABABABAAAABABBBBAABA'
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 39)

    def test_give__is_629(self):
        string = ''
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 629)

    def test_give__is_665(self):
        string = ''
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 665)

    def test_give__is_50216(self):
        string = ''
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 50216)

    def test_give_ABBBBABBBBBBBABABBBAABABBBBAABBAABBABBBBBBABABBBBABABBBBBBBBBBBBBBBBBBBBBBBBAABBBABBBBBBBBAABBBBBBBB_is_68(self):
        string = 'ABBBBABBBBBBBABABBBAABABBBBAABBAABBABBBBBBABABBBBABABBBBBBBBBBBBBBBBBBBBBBBBAABBBABBBBBBBBAABBBBBBBB'
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 68)

    def test_give_BAAAABBBBB_is_7(self):
        string = 'BAAAABBBBB'
        deletions = alternating_Characters(string)
        self.assertEqual(deletions, 7)